import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import FormComponent from './Components/FormComponent';
import MethodologySuggestionComponent from './Components/MethodologySuggestionComponent';
import NavbarComponent from './Components/NavbarComponent';
import ResultComponent from './Components/ResultComponent';

function App() {
  return (
    <Router>
      <div>
        <NavbarComponent />
        <Routes>
          <Route path="/" exact component={FormComponent} />
          <Route path="/suggestions" component={MethodologySuggestionComponent} />
          <Route path="/results" component={ResultComponent} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
